import BackgroundVideo from "./BackgroundVideo";

const RegisterLayout = props => (
  <React.Fragment>
  <div className="RegisterLayout">
      <BackgroundVideo />
      {props.children}
  </div>
  </React.Fragment>

);

export default RegisterLayout;
